  const onSubmet = async ()=> {
    const bassData = {
      email,
      password
    }
    try {
      await axion.post(login, bassData).then(res =>
        Preferences.set({
          key: ''
        })
        )
    } catch (e) {
      
    }

  }

  return (
    <>
    <div className='login-contianer'>
      <div >
        <label>البريد</label>
        <input type='text'/>
        <br/>
        <label>كلمه السر</label>
        <input type='password'/>
      </div>
      <button type='sunmet'>تسجيل الدخول</button>
    </div>
    </>
  )
}

export default Login
